import React from 'react';


function Card(props) {
    return(
        <div className="card-box">
          <h3 className="card-text">
            {props.cardTitle}
          </h3>
          <button className="show-answer">Show Answer</button>

        <div className="hidden-answer">
          <button id="remove-card">x</button>
          <h2>
            {props.cardAnswer}
          </h2>
          <button className="try-again">Try Again</button>
        </div>


        </div>
    )
}

export default Card;
